import React from "react";
import todo from "../src/logo.svg";

const App = () =>{
    return(
        <>
            <div className="main-div">
                <div className="center_div">
                    <figure>
                        <img src={todo} alt="todologo"/>
                    </figure>
                </div>
            </div>
        </>
    )
}

export default App;
